import React from 'react'
import {Link} from 'react-router-dom'


const Navbar = ()=> {
    return ( 
        <nav className="navbar navbar-dark bg-dark  shadow-sm p-3 ">
            <div className="container">
                <Link to='/' className="navbar-brand">Project Planning</Link>

            </div>
        </nav>
    );
}
 
export default Navbar;
